import React from 'react'
import ReactDOM from 'react-dom/client'
import './index.css'
import { App } from './App'
import reportWebVitals from './reportWebVitals'

//  class Tech = () => {
//    constructor( name, description, url, logo ) {
//             this.name = name,
//             this.description = description,
//             this.url = url,
//             this.logo = logo
//    }
// }

const createTechInfoObj = (techName, techDescription, techUrl, techImg, techAlt) => ({
    name: techName,
    Description: techDescription,
    Url: techUrl,
    Img: techImg,
    alt: techAlt
})

const react = createTechInfoObj("React.js", "", "", "", "")



//  const react = new Tech("React.js", "tech description", "", "reactLogo")


const root = ReactDOM.createRoot(document.getElementById('root'))
root.render(
    <App tech={react}/>
)

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals()
